import React from 'react';

const Repetitive = (props) => {
  const name = props.match.params.name;
  return (
    <video loop autoplay>
      <source src={`/static/videos/${name}.mp4`} type='video/mp4'/>
    </video>
  );
}

export default Repetitive;
